import React from "react";
import "../pages.css";

const videoThumbnails = document.querySelectorAll(
  ".video-gallery .all-videos .thumbnail"
);
const videoPlayer = document.querySelector(
  ".video-gallery .featured-video iframe"
);
const videoTitle = document.querySelector(".video-gallery .video-title");

const showVideo = (videoId, title) => {
  let videoUrl = `https://www.youtube.com/embed/${videoId}?rel=0`;
  videoPlayer.setAttribute("src", videoUrl);
  videoTitle.innerHTML = title;
};

videoThumbnails.forEach((v) => {
  v.addEventListener("click", () => {
    showVideo(v.dataset.id, v.dataset.title);
  });
});
let elements = document.querySelectorAll(".video-gallery .all-videos .video");

elements.forEach((i) => {
  i.addEventListener("click", function (e) {
    document.querySelector(".video.active").classList.remove("active");
    this.classList.add("active");
  });
});
export default function Html() {
  const Data = [
    {
      dataid: "hu-q2zYwEYs",
      datatitle: "Introduction",
    },
    {
      dataid: "mbeT8mpmtHA",
      datatitle: "HTML Basics",
    },

    {
      dataid: "YwbIeMlxZAU",
      datatitle: "HTML Forms"
    },

    {
      dataid: "D3iEE29ZXRM",
      datatitle: "CSS Basics"
    },

    {
      dataid: "FHZn6706e3Q",
      datatitle: "CSS Classes & Selectors"
    },

    {
      dataid: "kGW8Al_cga4",
      datatitle: "HTML 5 Semantics"
    },

    {
      dataid: "25R1Jl5P7Mw",
      datatitle: "Chrome Dev Tools"
    },

    {
      dataid: "XQaHAAXIVg8",
      datatitle: "CSS Layout & Position"
    },

    {
      dataid: "FMu2cKWD90g",
      datatitle: "Pseudo Classes & Elements"
    },

    {
      dataid: "Xig7NsIE6DI",
      datatitle: ",Intro to Media Queries"
    },
  ];

  return (
    <div className="main-container">
      <div className="video-gallery-container">
        <h2 className="title"> HTML and CSS crash course</h2>
        <div className="video-gallery">
          <div className="featured-video">
            <div className=" header video-title"> Introduction</div>

            <div className="responsive-iframe">
              <iframe
                width="560"
                height="315"
                src="https://www.youtube.com/embed/hu-q2zYwEYs?rel=0"
                title="YouTube video player"
                frameBorder="0"
                allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
                allowFullScreen
              ></iframe>
            </div>
          </div>
          <div className="all-videos-container">
            <div className="header">All Videos</div>
            <div className="all-videos">
              <div className="video active">
                <div
                  className="thumbnail"
                  data-id="hu-q2zYwEYs"
                  data-title="Introduction"
                >
                  Introduction
                </div>
              </div>

              <div className="video ">
                <div
                  className="thumbnail"
                  data-id="mbeT8mpmtHA"
                  data-title="HTML Basics"
                >
                  HTML Basics
                </div>
              </div>

              <div className="video">
                <div
                  className="thumbnail"
                  data-id="YwbIeMlxZAU"
                  data-title="HTML Forms"
                >
                  HTML Forms
                </div>
              </div>
              <div className="video">
                <div
                  className="thumbnail"
                  data-id="D3iEE29ZXRM"
                  data-title="CSS Basics"
                >
                  CSS Basics
                </div>
              </div>
              <div className="video">
                <div
                  className="thumbnail"
                  data-id="FHZn6706e3Q"
                  data-title="CSS Classes & Selectors"
                >
                  CSS Classes & Selectors
                </div>
              </div>
              <div className="video">
                <div
                  className="thumbnail"
                  data-id="kGW8Al_cga4"
                  data-title="HTML 5 Semantics"
                >
                  HTML 5 Semantics
                </div>
              </div>
              <div className="video">
                <div
                  className="thumbnail"
                  data-id="25R1Jl5P7Mw"
                  data-title="Chrome Dev Tools"
                >
                  Chrome Dev Tools
                </div>
              </div>
              <div className="video">
                <div
                  className="thumbnail"
                  data-id="XQaHAAXIVg8"
                  data-title="CSS Layout & Position"
                >
                  CSS Layout & Position
                </div>
              </div>
              <div className="video">
                <div
                  className="thumbnail"
                  data-id="FMu2cKWD90g"
                  data-title="Pseudo Classes & Elements"
                >
                  Pseudo Classes & Elements
                </div>
              </div>
              <div className="video">
                <div
                  className="thumbnail"
                  data-id="Xig7NsIE6DI"
                  data-title=" Intro to Media Queries"
                >
                  {" "}
                  Intro to Media Queries
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
